import Header from './components/Header';
import LandingSection from './components/LandingSection';
import { ChakraProvider } from '@chakra-ui/react';
import './App.css';

function App() {
  return (
    <div className="App">
      <ChakraProvider>
        <Header></Header>
        <LandingSection />  
      </ChakraProvider>
    </div>
  );
}

export default App;
